import React ,{ Component } from "react";
import {Route,Redirect,Link,Switch} from "react-router-dom";


class Homepage extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
        
    }
    render() { 
        return ( 
            <div><input type="button" value="Get Data" onClick={this.getValues.bind(this)} className="btn btn-danger" />  
            <strong> {JSON.stringify(this.state.departments)}</strong>
            <div className="container"> <strong>{this.state.message}</strong></div>
            </div>
         );
    }
}
 
export default Homepage;
